import React, { useState } from "react";
import data from "../data/data";
import {
  TabContent,
  TabPane,
  Nav,
  NavItem,
  NavLink,
  Card,
  Button,
  CardTitle,
  CardText,
  Row,
  Col,
} from "reactstrap";

const MyTabPanel = (props) => {
  const [activeTab, setActiveTab] = useState("1");

  const toggle = (tab) => {
    if (activeTab !== tab) setActiveTab(tab);
  };

  return (
    <div>
      <Title />
      <Tabs>
        <TabList>
          {data.map((project) => (
            <ReactTabs.Tab>{project}</ReactTabs.Tab>
          ))}
        </TabList>
      </Tabs>
    </div>
  );
};

export default MyTabPanel;
